#[inline]
pub fn backward(code: u32) -> u16 {
    let offset = (code >> 4) as uint;
    let offset = if offset < 12190 {BACKWARD_TABLE_UPPER[offset] as uint} else {0};
    BACKWARD_TABLE_LOWER[offset + ((code & 15) as uint)]
}

